import "./List.css"

function ListBox(props){
    return(
        <div className="list-box">
           <ul>
          {props.addList.map((obj,index)=>{
            return(<li key={index}>{obj}</li>)
          })}
           </ul>
        </div>
    )
}

export default ListBox;
